import React, { useState, useEffect, useRef } from 'react';

const PAGE_NUMBER = 1;

const TestData = () => {
  const [data, setData] = useState([]);
  const [containerHeight, setContainerHeight] = useState(0);
  const containerRef = useRef();
  const pageSize = 10; // Number of data points to load per page
  const maxIterations = 20; // Maximum number of iterations to prevent infinite loop
  const originalWindowHeight = window.innerHeight;
  const [page, setPage] = useState(PAGE_NUMBER);
  const [loading, setLoading] = useState(false);

  // ... (rest of the code)

  // Scroll logic
  const handleScroll = () => {
    // Add your scroll event handling logic here
    // For example, load more data when the user reaches the bottom of the container
    if (
      containerRef.current &&
      window.innerHeight + document.documentElement.scrollTop + 1 >=
        containerRef.current.scrollHeight
    ) {
      setLoading(true);
      setPage((prev) => prev + 1);
    }
  };

  // Debounce function to reduce the frequency of calling handleScroll
  const debounce = (callback, delay) => {
    let timeoutId;
    return function (...args) {
      if (timeoutId) {
        clearTimeout(timeoutId);
      }
      timeoutId = setTimeout(() => {
        callback.apply(this, args);
      }, delay);
    };
  };

  // Adding the event listener when the component mounts
  useEffect(() => {
    const debouncedHandleScroll = debounce(handleScroll, 100); // Adjust the delay as needed
    window.addEventListener('scroll', debouncedHandleScroll);

    // Removing the event listener when the component unmounts
    return () => {
      window.removeEventListener('scroll', debouncedHandleScroll);
    };
  }, []);

  // ... (rest of the code)

  return (
    <div ref={containerRef}>
      <h1>Test Data</h1>
      <ul>
        {data.map((item) => (
          <li key={item.id}>{item.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default TestData;
